        /// <summary>
        ///   Sucht eine lokalisierte Zeichenfolge, die Write Performance Log ähnelt.
        /// </summary>
        public static string WritePerformanceLog {
            get {
                return ResourceManager.GetString("WritePerformanceLog", resourceCulture);
            }
        }
    }
}
